import { Layout, Heading } from "../../components";
import { Calendar } from "./";
import { Player_AddButton, Player_Card } from "./Player";
import { Dash_View_Players_Styles } from "./Dash_Styles";
import { Team_Schedule } from "./Team";
import { Registration, User_Billing } from "../../forms/Forms";
import Reducer from "../../reducers";

const { Container } = Layout;

const billing = () => {
  return (
    <Container>
      <User_Billing>content</User_Billing>
    </Container>
  );
};

const schedule = () => {
  return (
    <Container className="Schedule_View_Entry">
      <Heading style={{ textAlign: "right", borderBottom: "1px solid black" }}>
        Calendar
      </Heading>
      <Calendar />
    </Container>
  );
};

const players = ({ dispatch, store }) => {
  return (
    <Container>
      <Dash_View_Players_Styles className="PlayerView_Entry">
        <div className="PlayerView_Container Player_Card_Button_Group">
          <Player_AddButton
            onClick={() =>
              dispatch({ type: "SHOW_MODAL", input: Registration })
            }
          />
          <Player_Card />
          <Player_Card />
        </div>
        <Team_Schedule className="PlayerView_Container" />
      </Dash_View_Players_Styles>
    </Container>
  );
};

const contact = () => {
  return <Container>content</Container>;
};
const Admin_View = {
  billing,
  schedule,
  contact,
  players,
};

const User_View = {
  billing,
  schedule,
  contact,
  players,
};

const Dash_Views = {
  Admin_View,
  User_View,
};

export default Dash_Views;
